function getID(){let e=document.getElementById("search").value;buildData(URLdata,e),document.getElementById("search").value=" "}function buildData(e,a){var t=[];fetch(e).then(function(e){return e.json()}).then(e=>{t=e.values,compareEntryData(t,a)})}function compareEntryData(e,a){let t=dataToArray(e),n=encriptadorId(a);if(-1!==t.indexOf(n)){let e="https://smartcenter.up.edu.mx/dpi/dpi.html?id="+n;window.open(e)}else alert("El alumno que estás buscando no está en nuestros registros")}function dataToArray(e){let a=[];for(let t=1;t<e.length;t++)a.push(e[t][0]);return a}function encriptadorId(e){let a=[];for(original=0;original<e.length;original++){let t;switch(e.charAt(original)){case"0":t="z",a.push(t);break;case"1":t="g",a.push(t);break;case"2":t="d",a.push(t);break;case"3":t="a",a.push(t);break;case"4":t="n",a.push(t);break;case"5":t="i",a.push(t);break;case"6":t="l",a.push(t);break;case"7":t="s",a.push(t);break;case"8":t="x",a.push(t);break;case"9":t="w",a.push(t)}}return a.join("")}const URLdata="https://sheets.googleapis.com/v4/spreadsheets/1WAvF8Qs9s9EK6mAv1KY9hpGKxdFQ5V9myJpTjBkECIE/values/main!A1:A?key=AIzaSyDzdEQYUcSwjzEmZNZhYd2vh1E_P6ykPAY";var searchBox=document.getElementById("search");searchBox.addEventListener("keydown",function(e){"Enter"===e.code&&getID(e)});